import React from 'react';
import '../index.css';
import Header from './Header.js';
import Main from './Main.js';
import Footer from './Footer.js';
import PopupWithForm from './PopupWithForm.js';

function App() {
  return (
    <div className="page">
      <div className="container">
        <Header />
        <Main />
        <Footer />
        <PopupWithForm name="edit" title="Редактировать профиль" buttonText="Сохранить" children="1"/>
        <PopupWithForm name="create" title="Новое место" buttonText="Создать" children="2"/>
        <PopupWithForm name="avatar-update" title="Обновить аватар" buttonText="Сохранить" children="3"/>
        <PopupWithForm name="confirm" title="Вы уверены?" buttonText="Да"/>
      </div>
    </div>
  );
}

export default App;
